const Message = ({ pic, message, time, isUser }) => {
  return (
    <div className="flex flex-row w-[95%] mx-auto mt-4">
      {/* profile photo */}
      {!isUser && (
        <div>
          <img src={pic} alt="" />
        </div>
      )}
      {/* message */}
      <div></div>
    </div>
  );
};

export default Message;
